import React from 'react';
import Home from './Container/Home/Home';
import Vision from './Container/Vision/Vision';
import Tableau from './Container/Tableau/Tableau';
import Footer from './Container/Footer/Footer_bottom';

function App() {
  return (
    <div className="App">
      <Home/>
      <Vision/>
      <Tableau/>
      <Footer/>
    </div>
  );
}

export default App;
